[FEATURE][ADD] - Adicionar arquivos de variáveis SASS

Adicionar arquivos de variáveis SASS, com a seguinte estrutura:
	* colors: Nome de cores e branding;
	* fonts: Nome de fontes, styles e weights;
	* properties: Propriedades com configuração padrão;
	* utils: Mixins para media queries e variáveis utilitárias;

